import { Link } from "react-router-dom";

function Login() {
  return (
    <div className="section">
      <h2>Login Page</h2>

      <input type="email" placeholder="Email" />
      <br /><br />

      <input type="password" placeholder="Password" />
      <br /><br />

      <button>Login</button>

      <p style={{ marginTop: 20 }}>
        <Link to="/">‚Üê Back to Home</Link>
      </p>
    </div>
  );
}

export default Login;
